public static Item fromJSON(String json) {

		Item node;
		Gson gson = GsonUtil.getSubtreeGson();

		node = gson.fromJson(json, Item.class);
		if (node.getId() == null || StringUtils.isBlank(node.getId())) {
			node.setId(IdGenerator.generate());
		}
		return node;
	}
